import react, {useEffect, useState} from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';

export default function DishList() {
    const [allDish, setAllDish] = useState([]);


    function findAllDish() {
        axios.get('/api/dish')
            .then(response => {
                setAllDish(response.data)
            })
            .catch(error => console.error(error));
    }

    useEffect(findAllDish, []);

    function base64ToImage(dish){
        if(dish.base64 != 'null'){
            return <img src={dish.base64}></img>
        } else {
            return;
        }
    } 

    const DishListComponent = [];
    for (let dish of allDish){
        DishListComponent.push(
            <div key={dish._id}>
                <h1>{dish.dishName}</h1>
                <h3>{dish.rank}</h3>
                {base64ToImage(dish)}
            </div>
        )
    }

    return (
        <div>
            <h1>These are all my Dish</h1>
            {DishListComponent}
        </div>
    )
}
